__NUXT_JSONP__("/svet/stat/rakousko", (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:[{place:[{id:b,mpz:"AT",tld:".at",name:"Rakousko",area:83858,population:9006400,slug:"rakousko",id_continent:4,number_cities:a,information_chatgpt:"Rakousko je stát nacházející se ve střední Evropě. Hraničí s Německem na severozápadě, s Českou republikou na severu, se Slovenskem na severovýchodě, s Maďarskem na východě, s Itálií na jihu a s Lichtenštejnskem a Švýcarskem na západě. S rozlohou přibližně 83 878 km² a asi 8,9 miliony obyvatel patří Rakousko mezi menší státy Evropy.\n\nHlavním městem Rakouska je Vídeň a úředním jazykem je němčina. Rakousko je známé pro svou bohatou kulturu a historii, včetně významných osobností, jako byli například Wolfgang Amadeus Mozart, Ludwig van Beethoven, Sigmund Freud a Gustav Klimt. Země je také známá pro své horské scenérie a přírodní krásy, jako jsou Alpy, Dunajský lom a jezera.\n\nRakousko je ekonomicky vyspělá země s vysokou životní úrovní. Je to exportně orientovaná ekonomika, specializující se na automobilový a strojírenský průmysl, turistiku, těžbu surovin a zpracování potravin. Rakousko je také známé pro své gastronomické speciality, jako jsou Wiener schnitzel, Sachertorte a rakouské víno.\n\nRakousko je federální parlamentní republikou, skládající se ze 9 spolkových zemí. Je to člen Evropské unie a OSN.",image_cover:c,image_hero:c,currency_code:"EUR",currency_name:"euro"}],placesCities:[{id:108,id_state:b,name:"Wels",population:60648,area:44.82,altitude:317,id_continent:a,id_administrative_unit:a,id_districts:a,slug:"wels",information_chatgpt:"Wels je město v Rakousku, nacházející se ve spolkové zemi Horní Rakousko. Je to osmé největší město v Rakousku a leží na břehu řeky Traun. Wels je známý pro své historické centrum, kde se nachází mnoho středověkých budov, jako například hrad Wels, katedrála svatého Ondřeje a stará radnice. Město je také populární pro své každoroční veletrhy a výstavy, jako je například Mezinárodní veletrh výstavby a rekonstrukce budov. Wels je také významným dopravním uzlem a důležitým průmyslovým centrem Horního Rakouska.",image_cover:a,image_hero:a},{id:106,id_state:b,name:"Klagenfurt",population:100316,area:120.04,altitude:447,id_continent:a,id_administrative_unit:a,id_districts:a,slug:"klagenfurt",information_chatgpt:"Klagenfurt je město v Rakousku, hlavní město spolkové země Korutany. Leží u břehu jezera Wörthersee a je šestým největším městem Rakouska. Klagenfurt je známý svými historickými památkami, jako je například zámek Landhaus, dóm svatého Petra a Pavla a Minimundus, což je park s malými modely slavných světových památek. Město je také centrem kulturního života Korutan, hostí mnoho festivalů a akcí, včetně Letního divadelního festivalu a Mezinárodního festivalu filmů o horské přírodě.",image_cover:d,image_hero:d},{id:107,id_state:b,name:"Villach",population:61473,area:134.26,altitude:501,id_continent:a,id_administrative_unit:a,id_districts:a,slug:"villach",information_chatgpt:"Villach je město v Rakousku, nacházející se v Korutanech, na jižním konci údolí řeky Drávy. Je to sedmé největší město Rakouska a je známé svou historickou architekturou, včetně Villacher Domu a Villacher Rathausu. Město je také populárním turistickým cílem, zejména v zimním období, díky své blízkosti k alpským střediskům jako je například Gerlitzen a Bad Kleinkirchheim. Villach je také hostitelem tradičního karnevalu, který se koná každý rok v únoru a je známý jako Villacher Fasching.",image_cover:e,image_hero:e},{id:110,id_state:b,name:"Dornbirn",population:48210,area:120.29,altitude:437,id_continent:a,id_administrative_unit:a,id_districts:a,slug:"dornbirn",information_chatgpt:"Dornbirn je město v Rakousku, nacházející se v spolkové zemi Vorarlbersko na západě Rakouska. Je to desáté největší město v Rakousku a leží na břehu řeky Dornbirner Ach. Dornbirn je známý svou moderní architekturou, včetně architektonického výstavního centra KUB (Kunsthaus Bregenz) a Riedenburgerhofu. Město je také populárním turistickým cílem díky své poloze v Alpách, které nabízí mnoho možností pro pěší turistiku a cyklistiku. Dornbirn je také centrem předního průmyslového regionu Vorarlberska, známého pro textilní průmysl, a je domovem několika významných muzeí a galerií, jako je například Vorarlberg Museum a Stadtmuseum Dornbirn.",image_cover:f,image_hero:f},{id:103,id_state:b,name:"Linz",population:206310,area:96.04,altitude:266,id_continent:a,id_administrative_unit:a,id_districts:a,slug:"linz",information_chatgpt:"Linz je město v Rakousku, hlavní město spolkové země Horní Rakousko. Leží na břehu Dunaje a je třetím největším městem Rakouska. Linz je známý svou moderní architekturou, včetně budovy Ars Electronica Center a budovy Brucknerhaus, která slouží jako koncertní hala. Město je také domovem k několika významným muzeím, jako je například Lentos Kunstmuseum a Muzeum vojenství Horního Rakouska.",image_cover:g,image_hero:g},{id:101,id_state:b,name:"Vídeň",population:1911728,area:414.78,altitude:171,id_continent:a,id_administrative_unit:a,id_districts:a,slug:"viden",information_chatgpt:"Vídeň je hlavním městem Rakouska a s více než 1,9 miliony obyvatel největším městem země. Leží na východě Rakouska na řece Dunaji a je významným kulturním, politickým a ekonomickým centrem střední Evropy.\n\nVídeň je známá svou architekturou, zejména barokními a secesními stavbami, a je domovem mnoha významných kulturních institucí, včetně opery, divadel a galerií. Město je také známé svým historickým dědictvím, včetně Hofburgu, bývalého císařského paláce, a Stephansdomu, gotické katedrály.\n\nVídeň je také důležitým centrem v oblasti vzdělání, vědy a výzkumu a má řadu prestižních univerzit a výzkumných institucí. Město je také známé svou kulinářskou scénou, včetně kávových domů, cukráren a restaurací, které nabízejí rakouskou kuchyni a další kuchyně z celého světa.\n\nVídeň je také důležitým dopravním uzlem, s mezinárodním letištěm a řadou dálnic a železničních tratí. Město je také známé svým veřejným dopravním systémem, včetně tramvají, autobusů a metra.",image_cover:h,image_hero:h},{id:109,id_state:b,name:"Sankt Polten",population:5104,area:.85,altitude:460,id_continent:a,id_administrative_unit:a,id_districts:a,slug:"sankt-polten",information_chatgpt:"Sankt Pölten je město v Rakousku, hlavní město spolkové země Dolní Rakousy. Leží na řece Traisen a je čtvrtým největším městem v Dolních Rakousích. Sankt Pölten je známý svou historickou architekturou, jako je například katedrála svatého Mikuláše a stará radnice. Město je také domovem několika muzeí, galerií a divadel, včetně Muzea Dolních Rakous a Kulturhausu Wagram. Sankt Pölten je důležitým dopravním uzlem a významným administrativním centrem Dolních Rakous.",image_cover:i,image_hero:i},{id:104,id_state:b,name:"Salcburk",population:156872,area:65.69,altitude:424,id_continent:a,id_administrative_unit:a,id_districts:a,slug:"salcburk",information_chatgpt:"Salcburk (německy Salzburg) je město v Rakousku, hlavní město spolkové země Salcbursko. Leží na řece Salzach a je čtvrtým největším městem v Rakousku. Salcburk je známý svou historickou architekturou a kulturním dědictvím, včetně Salcburského hradu, Katedrály svatého Ruperta a Festspielhausu, kde se každoročně koná Salcburský festival. Město je také rodištěm slavného skladatele Wolfganga Amadea Mozarta a turistickým cílem díky svému krásnému historickému centru a okolní přírodě.",image_cover:j,image_hero:j},{id:105,id_state:b,name:"Innsbruck",population:132493,area:104.91,altitude:574,id_continent:a,id_administrative_unit:a,id_districts:a,slug:"innsbruck",information_chatgpt:"Innsbruck je město v Rakousku, hlavní město spolkové země Tyrolsko. Leží v údolí řeky Inn a je pátým největším městem Rakouska. Innsbruck je obklopen horskými vrcholy a je významným turistickým cílem, zejména pro zimní sporty, jako je lyžování a snowboarding. Město je také známé svou historickou architekturou, včetně Zlaté střechy (Zlatého krovu), kde se nachází muzeum a výhled na okolní hory, a také Innsbruckým hradem. Innsbruck byl také hostitelem Zimních olympijských her dvakrát, v letech 1964 a 1976.",image_cover:k,image_hero:k},{id:102,id_state:b,name:"Graz",population:280026,area:127.56,altitude:353,id_continent:a,id_administrative_unit:a,id_districts:a,slug:"graz",information_chatgpt:"Graz je město v Rakousku, hlavní město spolkové země Štýrsko. Leží na řece Mur a je pátým největším městem Rakouska. Graz je známý svou historickou architekturou, včetně gotické katedrály, zámku Eggenberg a barokních budov v historickém centru města. Je také významným kulturním centrem, hostí řadu festivalů, výstav a kulturních akcí.",image_cover:l,image_hero:l}]}],fetch:{},mutations:void 0}}(null,12,"https:\u002F\u002Fimage.frytolnacestach.cz\u002Fstorage\u002Fworld\u002Fstates\u002Frakousko.jpg","https:\u002F\u002Fimage.frytolnacestach.cz\u002Fstorage\u002Fworld\u002Fcities\u002Fklagenfurt.jpg","https:\u002F\u002Fimage.frytolnacestach.cz\u002Fstorage\u002Fworld\u002Fcities\u002Fvillach.jpg","https:\u002F\u002Fimage.frytolnacestach.cz\u002Fstorage\u002Fworld\u002Fcities\u002Fdornbirn.jpg","https:\u002F\u002Fimage.frytolnacestach.cz\u002Fstorage\u002Fworld\u002Fcities\u002Flinz.jpg","https:\u002F\u002Fimage.frytolnacestach.cz\u002Fstorage\u002Fworld\u002Fcities\u002Fviden.jpg","https:\u002F\u002Fimage.frytolnacestach.cz\u002Fstorage\u002Fworld\u002Fcities\u002Fsankt-polten.jpg","https:\u002F\u002Fimage.frytolnacestach.cz\u002Fstorage\u002Fworld\u002Fcities\u002Fsalcburk.jpg","https:\u002F\u002Fimage.frytolnacestach.cz\u002Fstorage\u002Fworld\u002Fcities\u002Finnsbruck.jpg","https:\u002F\u002Fimage.frytolnacestach.cz\u002Fstorage\u002Fworld\u002Fcities\u002Fgraz.jpg")));